function Box(props) {
  const ref = useRef()
  useFrame((state, delta) => (ref.current.rotation.x += delta * 0.5))

  return (
    <mesh
      {...props}
      ref={ref}
      position={[0, 0, 0]}
    >
      <boxGeometry args={[2, 2, 2]} />
      <meshStandardMaterial color={'blue'} />
    </mesh>
  )
}

function App() {
  return (
    <Canvas>
      <ambientLight />
      <pointLight position={[10, 10, 10]} />
      <Box />
    </Canvas>
  )
}

export default App;
